export default function Services() {
  return (
    <div className="p-10 bg-pink-50 min-h-screen">
      <h2 className="text-3xl font-bold text-center text-pink-600 mb-10">
        Our Services
      </h2>

      <div className="grid grid-cols-1 md:grid-cols-3 gap-8">
        {[
          { name: "Facial", price: "₹800" },
          { name: "Haircut", price: "₹500" },
          { name: "Makeup", price: "₹1500" }
        ].map((service) => (
          <div
            key={service.name}
            className="bg-white p-6 rounded-xl shadow hover:shadow-lg transition"
          >
            <h3 className="text-xl font-semibold text-purple-500">
              {service.name}
            </h3>
            <p className="mt-2 text-gray-600">Starting from {service.price}</p>
          </div>
        ))}
      </div>
    </div>
  );
}
